// SPDX-License-Identifier: MIT
pragma solidity ^0.8.9;

import "./ArtalaxiesMarketV1.sol";
import "@openzeppelin/contracts-upgradeable/token/ERC721/ERC721Upgradeable.sol";
import "@openzeppelin/contracts-upgradeable/token/ERC721/extensions/ERC721URIStorageUpgradeable.sol";

contract ArtalaxiesMarketV2 is ArtalaxiesMarketV1{

    // For defalut URI.
    string private _defalutURI;

    // Useless, cus unable to initialize again in the network.
    function initialize()  public override initializer {
        __ERC721_init("Artalaxies Testing Market", "TARTX");
        __ERC721URIStorage_init();
        __ERC721Burnable_init();
        __AccessControl_init();
        __UUPSUpgradeable_init();

        _grantRole(DEFAULT_ADMIN_ROLE, msg.sender);
        _grantRole(MINTER_ROLE, msg.sender);
        _grantRole(UPGRADER_ROLE, msg.sender);
        setDefaultURI("https://article.cullen.ml/blockchain/artalaxies_default.json");
    }


    // Setting Default URI for BaseURI
    function setDefaultURI(string memory uri_) public onlyRole(DEFAULT_ADMIN_ROLE) {
        _defalutURI = uri_;
    }

    // Version of the Smart Contract.
    function version() public pure virtual override returns (string memory){
        return "v2";
    }

    // Get a URI form a token
    function tokenURI(uint256 tokenId)
        public
        view
        virtual
        override
        returns (string memory)
    {
        string memory _tokenURI = super.tokenURI(tokenId);

        if (bytes(_tokenURI).length > 0) {
            return _tokenURI;
        }else{
            return _defalutURI;
        }
    }

}
